import React from 'react';
import styled from 'styled-components';
import Animal from './Animal.json';

const Container = styled.div`
    position:absolute;
    width:100%;
    height:100%;
    background-color:#d5def5;
`;

function Animals() {
  console.log(Animal);
  return (
    <Container>
      {
        Animal.map(item => {
          return(
            <h3>{item.name}</h3>
          )
        })
      }
    </Container>
  )
}

export default Animals
